import '../stylesheets/App.css';
import data from '../data/data.json';

const App = () => {
	return console.log(
		data.sort(function (x, y) {
			if (x.time > y.time) {
				return 1;
			} else if (x.time < y.time) {
				return -1;
			} else {
				return 0;
			}
		})
	);
};

export default App;
